import {store} from '..store'

// eslint-disable-next-line import/no-anonymous-default-export
dashboardReducer = (store,action)=>{
    switch(action.type){
        case 'SHOW_DASHBOARD':
            return{
                dashboard:action.payload
            }
        default:
            return state
    }
}
